import React from 'react'
import { MapContainer, TileLayer, useMap } from 'react-leaflet'

function MapArea({latitude, longitude}) {
  return (
    <div className='map-area'>

    <MapContainer center={[latitude]}>

    </MapContainer>
    </div>
  )
}

export default MapArea
